from scrapy.settings import Settings
from scrapy.crawler import CrawlerProcess
from bookparser import settings
from bookparser.spiders.labirintru import LabirintruSpider
from bookparser.spiders.book24ru import Book24ruSpider
from pymongo import MongoClient

if __name__ == '__main__':
    settings_m = Settings()
    settings_m.setmodule(settings)
    process = CrawlerProcess(settings=settings_m)
    process.crawl(LabirintruSpider)
    process.crawl(Book24ruSpider)
    process.start()

    # проверка данных в MongoDB
    client = MongoClient('192.168.1.3', 27017)
    mongo_base = client.books
    collection = mongo_base['books']
    for n in collection.find({}):
        print(n)

